import React from 'react';
import styled from 'styled-components';

const Nav = styled.nav`
	width: 100%;
	padding: 1rem;
	background-color: white;
`;

const NavBar = () => {
	return (
		<div>
			<img alt="Logo"></img>
		</div>
	);
};

export default NavBar;
